import styled from 'styled-components';

export const HeaderText = styled.h3`
  font-size: 2em; //32px
  font-weight: 600;
  line-height: 24px;
  color: #555770;
`;

export const HeadingMedium = styled.h3`
  font-weight: 500;
  font-size: 18px;
  line-height: 24px;
  color: #555770;
`;
